(17, 'The One Dolce & Gabbana 100mL', 15000, 70000, 70000, '6435818818d8e-1681228168.jpg', '2023-03-30 07:24:00', 131, 58, 'L’Eau de Parfum One For Men de Dolce & Gabbana est une icône remarquable de la masculinité orientale, offrant une expérience olfactive plus intense qui ravira les experts en parfumerie. Masculin et captivant, ce parfum extrêmement intense devient instantanément une déclaration de glamour et de sophisticatio', '6970323818047', '2023-06-27 07:13:42', 0, 18, 10, NULL, NULL, NULL, 53, 16),
(18, 'Azzaro Wanted By Night 100mL', 15000, 70000, 70000, '642571b6475fa-1680175542.png', '2023-03-30 07:25:42', 8, 30, 'Êtes-vous prêt à affronter n’importe quelle tâche ? Azzaro présente Wanted, une Eau de Toilette énergisante dédiée aux hommes hédonistes et vifs, capables de saisir leur chance et de défier leur destin. Azzaro Wanted, c’est le zeste de la cardamome, le côté boisé du vétiver et l’élégante fève tonka chaude au milieu d’un flacon élégant en forme de tonneau… comme le symbole de la liberté.', '', '2023-06-27 07:36:23', 0, 18, 10, NULL, NULL, NULL, 53, 16),
(19, 'Terre D’Hermès 100mL', 15000, 65000, 65000, '64257233d5971-1680175667.webp', '2023-03-30 07:27:47', 0, 24, 'Terre d’Hermès raconte la relation de l’homme avec la terre et son dialogue humble et harmonieux avec la nature et les éléments. Terre d’Hermès est un parfum qui relie les gens à leur origine, source de créativité.', NULL, '2023-06-23 13:42:43', 0, 18, 10, 6, NULL, NULL, NULL, 16),
(20, 'Bleu de Chanel 150mL', 10000, 130000, 130000, '642572da7928b-1680175834.jpg', '2023-03-30 07:30:34', 8000, 0, 'L’émerveillement de la liberté masculine, dans un parfum aromatique boisé au sillage intriguant. Un parfum intransigeant et intemporel dans un flacon bleu mystérieux. L’esprit de non-conformité de BLEU DE CHANEL prend la forme d’une eau de parfum masculine. C’est un signal olfactif plus radical pour plus de confiance en soi.', '', '2023-06-27 07:53:15', 0, 18, 10, 8, NULL, NULL, NULL, 16),
(21, 'CAMPO VIEJO RESERVA 6/75CL', 11000, 17000, 17000, '642d4efe6e6ce-1680690942.jpg', '2023-03-30 07:31:53', 200, 0, ' Bouche riche avec des fruits rouges et noirs mûrs, des notes boisées subtiles avec des notes de réglisse et de cacao. Un vin rouge complexe mais accessible de la première région viticole espagnole de la Rioja élaboré par le principal domaine viticole Campo Viejo. Un beau vin rouge espagnol structuré avec des caractères de fruits tels que les cerises et les mûres mûres. Le vin a des tanins élégants et doux, un poids moyen, une finale longue et complexe.  A déguster avec des viandes rôties, du thon grillé, du rôti du dimanche ou des lasagnes aux légumes. Ce vin fait un excellent cadeau et est le complément parfait à toute occasion spéciale', NULL, '2023-05-19 14:24:02', 0, 24, 12, NULL, NULL, NULL, 52, 17),
(22, 'Cerruti 1881 Signature 100mL', 50000, 75000, 75000, '64257347bb961-1680175943.jpg', '2023-03-30 07:32:23', 850, 0, 'L’eau de toilette pour homme Cerruti 1881 Pour Homme a une composition très raffinée, comme si l’on cherchait à allier la discrétion à la volonté d’être différent. Vous aussi, profitez de ce parfum unique, qui accentuera parfaitement votre charisme', NULL, '2023-03-30 07:32:23', 0, 18, 10, NULL, NULL, NULL, NULL, 16),
(23, 'Intenso Dolce & Gabbana', 40000, 65000, 65000, '642573e3e10cf-1680176099.webp', '2023-03-30 07:34:59', 743, 0, 'L’eau de parfum Dolce & Gabbana Pour Homme Intenso a été créée pour les hommes dont le cœur reste fidèle à la tradition.', NULL, '2023-06-23 13:42:43', 0, 16, 10, NULL, NULL, NULL, NULL, 16),
(24, 'Versace EROS 100mL', 40000, 70000, 70000, '642574312c01b-1680176177.jpg', '2023-03-30 07:36:17', 896, 0, 'Le monde masculin de VERSACE se découvre dans toute sa force et sa sensualité à un nouveau niveau de sophistication. Eros, le dieu de la gloire, dont les flèches invincibles vous feront succomber à l’amour, atteindre des sommets de passion et rayonner des désirs jamais vus auparavant dans les limites du tabou.', NULL, '2023-03-30 07:36:17', 0, 18, 10, NULL, NULL, NULL, NULL, 16),
(25, 'Chopard Oud Malaki 80mL', 45000, 65000, 65000, '642574b853c6e-1680176312.webp', '2023-03-30 07:38:32', 8520, 0, 'Chopard vous offre l’expression ultime de l’Orient avec l’eau de parfum Oud Malaki. Rencontrez l’Occident. Ce parfum ambré séduisant commence par une note de tête lumineuse, suivie de notes herbacées de pamplemousse, de lavande et d’absinthe. En note de fond, la chaleur du tabac et des épices ajoute une touche sensuelle au parfum, évoquant les mille et une nuits.', NULL, '2023-03-30 07:38:32', 0, 18, 10, NULL, NULL, NULL, 53, 16),
(27, 'L’interdit Givenchy 30mL', 45000, 70000, 70000, '6425753f3f76f-1680176447.jpg', '2023-03-30 07:40:47', 741, 0, 'L’interdit de Givenchy est un parfum libérateur, une invitation a aller au delà de ses propres limites, dépasser toutes les conventions et assurer hautement sa singularité.', NULL, '2023-03-30 07:40:47', 0, 18, 10, NULL, NULL, NULL, NULL, 16),
(28, 'La Vie est Belle 100mL', 45000, 85000, 85000, NULL, '2023-03-30 07:42:00', 5640, 0, 'Le parfum iconique du bonheur Bien plus qu’un réveil, La Vie Est Belle porte un message universel et intemporel et propose une vision affirmée du bien-être contemporain. Un bonheur ancré dans l’ici et maintenant, à portée de main. Plus que jamais, La Vie Est Belle invite chaque femme à capturer ce bonheur en faisant de chaque instant un moment unique.', NULL, '2023-03-30 07:42:00', 0, 16, 10, NULL, NULL, NULL, 53, 16),
