(39, 'DOMAINE LA BAUME SYRAH RED DRY 14.5% 6/75CL', 12000, 17000, 17000, '642c5fe0d4ba4-1680629728.webp', '2023-03-30 07:58:30', 200, 0, 'C\'est simple mais savoureux, avec des saveurs confiturées de cerise rouge et de framboise qui inondent le nez et le palais. Les tanins sont doux, mais donnent juste assez d\'adhérence texturale jusqu\'à la fin. Profitez-en maintenant. Lauren Buzzéo', NULL, '2023-05-17 14:50:58', 0, 24, 12, NULL, NULL, NULL, 52, 17),
