(41, 'ACQUA DI GIO 250mL', 7500, 15000, 15000, NULL, '2023-03-30 08:00:58', 8520, 0, 'ACQUA DI GIO 250mL', NULL, '2023-03-30 08:00:58', 0, 17, 10, NULL, 14, NULL, 53, 16),
(42, 'FREIXENET CARTA NEVADA SEMI SECO 11.5% 6/75CL', 12000, 17000, 17000, '64257a49acb19-1680177737.jpg', '2023-03-30 08:02:17', 200, 0, 'Un arôme fruité discret, légèrement sucré, très moelleux, un bel équilibre entre sucre et acidité. Un vin pour toutes les occasions', NULL, '2023-05-17 14:52:08', 0, 24, 14, NULL, NULL, NULL, 52, 17),
(43, 'FREIXENET CORDON NEGRO GRAN CUVEE 11.5% 6/75CL', 9000, 15000, 15000, '642c601c67167-1680629788.jpg', '2023-03-30 08:05:31', 200, 0, 'Le Cava de Barcelone est élaboré, dès le XIXe siècle, sur les terres de la Freixeneda, la « Frêneraie », grande propriété familiale, baignée de soleil et bordée de frênes et de chênes. On y déguste le Cava à l\'ombre des arbres, en déjeunant entre amis, ou durant les chaudes et longues soirées d\'été.Une bulle unique est née. Et un nom : Freixenet. C\'est le début d\'un succès.Le Cava de Barcelone s\'exporte rapidement dans le monde entier. Et la traditionnelle entreprise familiale donne naissance au 1er Groupe Mondial producteur de vin effervescent.  Le Cordon Noir est la cuvée phare. Elle se présente comme le compagnon idéal de vos apéritifs improvisés ou dinatoires avec ses délicieuses notes d\'agrumes et de pomme verte !À l\'oeil : jaune pâle brillant, avec une bulle fine et persistante.', NULL, '2023-05-17 14:57:25', 0, 24, 15, NULL, NULL, NULL, 52, 17),
(44, ' Alien 250mL', 7500, 15000, 15000, NULL, '2023-03-30 08:07:28', 5460, 0, 'Alien 250mL', NULL, '2023-03-30 08:07:28', 0, 17, 10, NULL, NULL, NULL, 53, 16),
(45, 'FREIXENET CORDON ROSADO BRUT 12% 6/75CL', 10000, 15000, 15000, '64257bc345620-1680178115.webp', '2023-03-30 08:08:35', 200, 0, 'Idéale pour un apéritif, le Freixenet Cordon Rosado Brut Rosé est la version rosé du Cava.   Sa robe gaie et attrayante, sa bulle fine et élégante, son doux arôme de fleurs et de fruits rouges, donnent le ton aux apéritifs festifs et vos plats de pâtes les plus créatifs.  Frais et léger en bouche, il rappelle les vins caractéristiques de la région Cava !', NULL, '2023-05-17 14:59:14', 0, 24, 16, NULL, NULL, NULL, 52, 17),
(46, ' Black XS l’excès de paco rabane 250mL', 7500, 15000, 15000, NULL, '2023-03-30 08:08:48', 8560, 0, 'Black XS l’excès de paco rabane 250mL', NULL, '2023-03-30 08:08:48', 0, 17, 10, NULL, NULL, NULL, NULL, 16),
(47, ' Coco Mademoiselle Chanel 250mL', 7500, 15000, 15000, NULL, '2023-03-30 08:09:39', 850, 0, 'Coco Mademoiselle Chanel 250mL', NULL, '2023-03-30 08:09:39', 0, 16, 10, 8, NULL, NULL, NULL, 16),
