(49, 'Dior Adict 250mL', 7500, 15000, 15000, NULL, '2023-03-30 08:11:44', 700, 0, 'Dior Adict 250mL', NULL, '2023-03-30 08:11:44', 0, 18, 10, 7, NULL, NULL, NULL, 16),
(50, 'GOLD PROSECCO SPUM. DOC BOTTEGA 11% 150CL', 55000, 65000, 65000, '64257c830884d-1680178307.jpg', '2023-03-30 08:11:47', 200, 0, '100% Glera, tous issus de la région DOCG de Valdobbiadene. Ce n\'est que parce que la réglementation du DOCG interdit les bouteilles fantaisie que ce vin sort de l\'appellation. Concernant la bouteille elle-même, elle a été pulvérisée selon une procédure unique et non avec une chaussette en plastique comme autant d\'alternatives bon marché. Le vin lui-même est fruité complexe avec un éclat doux mais constant, le goût est uniforme et fin. Une sensation sèche avec 11 grammes par litre de sucre résiduel. Le meilleur travail!  Gastronomie: En apéritif ou dans les meilleurs cocktails, des plats de poisson blanc pur ou de la viande blanche grillée, des salades aux fruits ou tout simplement à déguster par une belle journée d\'été.', NULL, '2023-05-17 15:01:01', 0, 24, 15, NULL, NULL, NULL, 52, 17),
(51, 'Good Girl 250mL', 7500, 15000, 15000, NULL, '2023-03-30 08:15:01', 850, 0, 'Good Girl 250mL', NULL, '2023-03-30 08:15:01', 0, 17, 10, NULL, NULL, NULL, 53, 16),
(52, 'Hypnotic Poison de Dior 250mL', 7500, 15000, 15000, NULL, '2023-03-30 08:15:57', 850, 0, 'Hypnotic Poison de Dior 250mL', NULL, '2023-03-30 08:15:57', 0, 17, 10, 7, NULL, NULL, NULL, 16),
(53, 'Kouros Body de Yves Saint Laurent 250mL', 7500, 15000, 15000, NULL, '2023-03-30 08:16:51', 850, 0, 'Kouros Body de Yves Saint Laurent 250mL', NULL, '2023-03-30 08:16:51', 0, 17, 10, NULL, NULL, NULL, 53, 16),
(54, 'La nuit Trésor 250mL', 7500, 15000, 15000, NULL, '2023-03-30 08:17:53', 500, 0, 'La nuit Trésor 250mL', NULL, '2023-03-30 08:17:53', 0, 17, 10, NULL, NULL, NULL, 53, 16),
(55, 'GOLD PROSECCO SPUM. DOC BOTTEGA 11% 75CL', 28500, 35000, 35000, '64257df75af63-1680178679.jpg', '2023-03-30 08:17:59', 200, 0, 'Bottega Gold est un Prosecco DOC obtenu à partir de la vinification des raisins Glera. L\'élégance, la fraîcheur et la vitalité de ses bulles reflètent la beauté et la tradition du territoire dont il est issu, brodé par les vignes, capable de se distinguer par ses formes physiques et géographiques, où la vigne a assumé un rôle central pendant des siècles. La zone de culture du raisin Glera est située près des Préalpes vénitiennes et se caractérise par des hivers longs mais pas excessivement froids et des étés chauds mais pas humides. Les vignes de ces zones poussent sur des sols de nature différente, avec une variabilité des sols, des expositions, des pentes qui font de ce Prosecco un vin aux multiples nuances. Les terrains vallonnés sont soumis à de fortes variations de température entre le jour et la nuit. Cette différence de température permet le développement d\'arômes plus fins, plus élégants et en même temps plus intenses.', NULL, '2023-05-17 15:02:24', 0, 24, 15, NULL, NULL, NULL, 52, 17),
(56, 'La petite robe rose 250mL', 7500, 15000, 15000, NULL, '2023-03-30 08:18:39', 500, 0, ' La petite robe rose 250mL', NULL, '2023-03-30 08:18:39', 0, 17, 10, NULL, NULL, NULL, 53, 16),
