(61, 'JACOB\'S CREEK WINEMAKERS RESERVE SHIRAZ RED 6/75CL', 20000, 25000, 25000, '64257f1c6bba6-1680178972.jpg', '2023-03-30 08:22:52', 200, 0, 'Contient : 6 x Jacobs Creek Reserve Shiraz Red Wine, 75 cl Présente des saveurs de prune mûre, d\'épices noires, de tanins luxuriants et de chêne moka riche Les raisins sont égrappés et écrasés, fermentés sur les peaux pendant 8 à 12 jours avant d\'être pressés, le vin est ensuite vieilli en fût de chêne pendant 6 à 8 mois supplémentaires avant la mise en bouteille Arôme - petits fruits noirs, épices entourées de chocolat sucré et d\'un soupçon de vanille Goût - riche en bouche rempli de prune noire, fruité mais avec une structure tannique riche et généreuse ainsi qu\'une bonne longueur Dégustez-le avec un steak de filet de scotch ou un plat de pâtes copieux, comme des spaghettis à la bolognaise', NULL, '2023-05-17 15:03:59', 0, 24, 12, NULL, NULL, NULL, 52, 17),
