(65, 'JP CHENET MEDIUM SWEET ROSE 11.5% 6/75CL ', 5000, 10000, 10000, '6425803b9fbb6-1680179259.jpg', '2023-03-30 08:27:39', 200, 0, 'Des arômes de fruits rouges tels que les fraises des bois et de bonbon à la rose.  Robe rose framboise éclatante.  SUGGESTION: Une soirée entre amis d\'enfance, pizza et brochette de chamallows !  SERVIR À : 8-10°C.', NULL, '2023-05-17 15:06:29', 0, 24, 17, NULL, NULL, NULL, 52, 17),
(66, 'Scandal de Jean Peaul Gautier 250mL', 7500, 15000, 15000, NULL, '2023-03-30 08:32:08', 850, 0, 'Scandal de Jean Peaul Gautier 250mL', NULL, '2023-03-30 08:32:08', 0, 18, 10, NULL, NULL, NULL, 53, 16),
