(68, 'LOUIS ESCHENAUER CHARDONNAY MEDOC 6/75CL', 8500, 14000, 14000, '6425819a29ab3-1680179610.jpg', '2023-03-30 08:33:30', 200, 0, 'CÉPAGE 100% Chardonnay. VINIFICATION Les raisins sont récoltés une fois arrivés à maturité puis pressées à basse température. La fermentation, à basse température (15-17 ° C), s\'étend sur une semaine. SOL Argilo-calcaire, sables et schistes. ROBE Une robe dorée avec quelques reflets verts. NEZ Un bouquet riche en expression avec des notes de fleur d\'acacia, de beurre frais, d\'ananas ou encore de fruits tropicaux. BOUCHE Un palet riche, gras et harmonieux avec des notes citronnées. RECOMMANDATION Ce vin sera votre partenaire idéal pour tous vos apéritifs, vos poissons en sauce, viandes blanches ou volaille. SERVIR de 10 à 12°C. DURÉE DE CONSERVATION 2 ans.', NULL, '2023-05-19 07:34:42', 0, 24, NULL, NULL, NULL, NULL, 52, 17),
