(77, 'LOUIS ESCHENAUER CHARDONNAY WHITE MED.DRY 13% 6/75CL', 8500, 15000, 15000, '642583fce27ba-1680180220.jpeg', '2023-03-30 08:43:40', 200, 0, 'Vin blanc sec  Le vin Louis Eschenauer Chardonnay Languedoc présente une robe dorée avec quelques reflets verts. Son bouquet est riche, exprimant des notes de fleurs d\'acacia, de beurre frais, d\'ananas et de fruits tropicaux. La bouche est riche, charnue et harmonieuse avec des notes citronnées.  Louis Eschenauer est un vigneron français renommé avec plus de 200 ans d\'histoire de la vinification à Bordeaux et plus récemment dans le Languedoc. Ce Chardonnay a été produit à partir de raisins cultivés dans des vignobles aux sols argilo-calcaires, sablonneux et schisteux.  Ce vin sera un partenaire idéal pour vos apéritifs, plats riches de poissons, viandes blanches et volailles.  Consister: Veuillez trouver les informations exactes sur les ingrédients sur l\'emballage du produit.', NULL, '2023-05-17 15:11:20', 0, 24, 13, NULL, NULL, NULL, 52, 17),
(78, 'LOUIS ESCHENAUER RESERVE BORDEAUX SUPERIEUR 13% 6/75CL', 8500, 15000, 15000, '642585c5bb941-1680180677.png', '2023-03-30 08:51:17', 200, 0, 'Vignobles sur coteaux argileux, au coeur de l’Entre Deux Mers, entre les rivières Garonne et Dordogne. Mis en bouteille dans la zone de production, les raisins sont nettoyés des grappes. Le vin Louis Eschenauer Réserve de Bordeaux est fermenté à une température contrôlée, et l’ensemble du processus prend 10-18 jours. Elevage en cuves et barriques. Couleur : rouge intense Bouquet : fin et élégant, aux arômes de fruits rouges, notes de bois et de vanille Goût : riche, charnu, aux tanins veloutés Association culinaire : peut être servi avec des plats de viande rouge en sauce ou avec tout type de fromage Température de service : 16-18°C Potentiel de cave : 2 à 5 ans', NULL, '2023-05-17 15:15:46', 0, 24, 12, NULL, NULL, NULL, 52, 17),
(79, 'MONDORO ASTI GIFT BOX 7.5% 6/75CL', 17000, 22000, 22000, '6425874f5d177-1680181071.jpg', '2023-03-30 08:57:51', 200, 0, 'Produit à partir de 100% de raisins Moscato d\'Asti du Piémont - région d\'Asti en Italie. Bulles fines et consistantes, couleur jaune paille clair brillant, arôme délicat, frais et fruité, goût sucré et un arrière-goût élégant et agréable. Servir en apéritif ou en combinaison avec des desserts légers. Servir entre 8º et 10ºC.', NULL, '2023-05-17 15:37:59', 0, 24, 14, NULL, NULL, NULL, 52, 17),
(80, 'PETALO AMORE MOSCATO SPUMANTE 6.5% 75CL', 17000, 25000, 25000, '642588729e7ee-1680181362.webp', '2023-03-30 09:02:42', 200, 0, 'Bottega Vina Dell\'Amore Petalo Moscato est un vin mousseux Muscat produit avec les meilleurs raisins de la Vénétie en Italie. Grâce à la grande diffusion de la culture des roses dans cette région, pendant la période de la floraison les abeilles transmettent les parfums très délicats de cette fleur aux plantes des vignes et le vin aussi se caractérise par les inévitables senteurs de la rose, évoquée par l\'image des pétales sur l\'étiquette.   De couleur Jaune Pailleté, ce Moscato est brillant laissant apparaître une mousse consistante et persistante avec un perlage très fin. Le nez est bien défini, intense et délicat.   Au goût, ce Moscato est fragrant, délicat et très doux avec des senteurs de rose très délicates et des arômes d\'agrumes, de miel et de pêche.   Caractéristiques Chimiques: ABV 6.5%  Température de service: 5-6°C  À Consommer: Idéal pour vos fêtes et les évènements spéciaux. Il est capable d\'accompagner les principaux desserts italiens et s\'accorde également avec les fromages. ', NULL, '2023-05-18 17:26:50', 0, 24, NULL, NULL, NULL, NULL, 52, 17),
(81, 'PETALO AMORE MOSCATO SPUMANTE 6.5% 150CL', 32000, 37000, 37000, '6425895520cf9-1680181589.jpg', '2023-03-30 09:06:29', 200, 0, 'Le Vino dell\'Amore Petalo Moscato est un vin mousseux blanc caractérisé par une douceur certaine mais pas écoeurante, avec un bouquet marqué mais élégant, une teneur en alcool modérée et une touche typique de rose qui évoque l\'image des pétales imprimés sur l\'étiquette. Magnum.', NULL, '2023-05-19 12:06:30', 0, 24, NULL, NULL, NULL, NULL, 52, 17),
(82, 'RIUNITE: LAMBRUSCO EMILIA IGT', 10000, 15000, 15000, '64258aef73ca4-1680181999.png', '2023-03-30 09:13:19', 200, 0, 'Vignobles situés entre la plaine moyenne et les basses collines de la province de Reggio Emilia. 85% Lambrusco Marani, Lambrusco Salamino, Lambrusco Maestri 15% Ancellotta. Robe: rouge vif Bouquet: frais, notes fruitées de cerise, agréable et persistant Bouche: doux et harmonieux. Alcool: 7,5% vol Sucres: 50 g/l, Vin à déguster avec tout type de plat. Il accompagne bien en particulier les charcuteries, les fromages et les légumes grillés Température de service 10-12°C format 75 cl', NULL, '2023-05-18 18:03:10', 0, 24, NULL, NULL, NULL, NULL, 52, 17),
(83, 'RIUNITE: MASCHIO SPUMANTE GRAN CUVEE 2019', 20000, 25000, 25000, '64258c646663a-1680182372.png', '2023-03-30 09:19:32', 25000, 0, 'Certains moments représentent des choses magiques et enflamment la joie. Des moments où le cœur et le palais s\'ouvrent pour accueillir des sensations pétillantes. Avec Gran Cuvée vous pouvez le déguster, savourer ses arômes, les arômes vous enveloppent dans une atmosphère magique, où tout coule pour créer des émotions uniques et nouvelles.  1', NULL, '2023-05-18 18:06:08', 0, 24, NULL, NULL, NULL, NULL, NULL, 17),
(84, 'RIVE DE LOUDENNE MEDOC 6/75CL', 11000, 16000, 16000, '64258e16c5539-1680182806.png', '2023-03-30 09:26:46', 200, 0, 'Le haut médoc est situé en amont de l\'estuaire de la gironde. La composition importante de son sol en graves incite à cultiver le cabernet sauvignon. Les vins sont concentrés avec une charpente tannique telle qu\'il faut un élevage d\'au moins 6 mois. Son nez offre dans sa jeunesse des arômes de fruits rouges et noirs pour évoluer vers les épices et plus ou moins de vanille en fonction de l\'élevage. Les haut médocs sont de grands vins de garde. le millésime 1981 est un millésime un peu méconnu, car austère à ses débuts. Il a favorablement évolué et peut offrir encore de bonnes bouteilles.', NULL, '2023-05-19 07:36:45', 0, 24, 12, NULL, NULL, NULL, 52, 17),
(85, 'RUFFINO CHIANTI DOCG 6/75CL', 8500, 13500, 13500, '64258e9e7aedc-1680182942.webp', '2023-03-30 09:29:02', 200, 0, 'Le domaine de Santedame est situé dans la célèbre Conca d\'Oro, embellie par l\'ancienne chapelle de la Madonna di Santedame. Les faibles rendements et l\'état particulier du sol favorisent la production d\'un vin authentique, au style typiquement toscan. Une charmante forêt de cyprès entoure le domaine.', NULL, '2023-05-18 18:22:43', 0, 24, 12, NULL, NULL, NULL, 52, 17),
