(96, 'RUFFINO MODUS 6/75CL', 36000, 42000, 42000, '642590e6c95dd-1680183526.webp', '2023-03-30 09:38:46', 200, 0, 'Modus - le mot latin pour méthode et mesure - est l\'expression moderne du Ruffino dans l\'union de trois cépages nobles. Lancé en 1997, c\'est un Supertuscan qui a remporté des prix et des critiques favorables dans le monde entier et qui est la synthèse de tous les éléments qui contribuent à son caractère unique : les vignes, le soleil, le sol et le travail de l\'homme.  Un vin riche et persistant, aux tanins doux et à la grande structure, avec un grand impact aromatique et gustatif, qui se lit à plusieurs niveaux : de l\'expression élégante à la touche aristocratique du bois et des épices. Une gorgée charnue, sculptée dans la tridimensionnalité de ses cépages. ', NULL, '2023-05-18 18:26:03', 0, 24, 12, NULL, NULL, NULL, 52, 17),
