(125, 'BT 75CL AOP COTES DU RHONE ROUGE GALETS', 8000, 15000, 15000, '642597676ae9e-1680185191.jpg', '2023-03-30 10:06:31', 200, 0, 'Culture biologique. Vendanges mécaniques. Vendanges entières, Fermentation en cuve en ciment avec résine époxy, Bâtonnage régulier. Elevage en cuve en ciment avec résine époxy, Assemblage, Filtration légère, Bouchon traditionnel en liège. Sols argileux, Sols calcaires, Sols de galets. Couleur violine, intense, reflets pourpres. Elégant, fin, subtils arômes de cassis, subtils arômes de cerise, généreux arômes de fruits rouges. Intense, soyeuse, légères notes de cassis, généreuses notes de cerise, généreuses notes de fruits rouges, tanins elégants, tanins fins, rond, corps structuré, bonne intensité, longue persistance. Accords mets & vin Viandes rouges grillées, Viandes blanches, Gibiers à plume, Volailles, Fromages de vache Temps de garde 16° - 18°', NULL, '2023-05-18 18:27:22', 0, 24, 12, NULL, NULL, NULL, 52, 17),
(126, 'BT 75CL AOP COTES DU RHONE ROUGE CUVEE MARIE', 9500, 15000, 15000, '6425984cab3c8-1680185420.jpg', '2023-03-30 10:10:20', 200, 0, 'À l\'oeil : Jolie robe rubis profond aux reflets violets.  Au nez : Nez fin et délicat, aux notes gourmandes de cerise, de prune et de violette. En bouche : Son fruité intense souligne un équilibre général.', NULL, '2023-05-18 18:28:13', 0, 24, 12, NULL, NULL, NULL, 52, 17),
(127, 'BT 75CL AOP COTES DU RHONE ROUGE CUVEE VIRGINIE MEDAILLE D’OR A PARIS', 10000, 15000, 15000, '642599a40e67b-1680185764.png', '2023-03-30 10:16:04', 200, 0, 'Cotes du Rhône cuvée VIRGINIE, ce vin se compose de 2 cépages le syrah et le grenache tannique et généreux, une robe soyeuse et d\'un bel équilibre de fruits murs, il s\'accorde à merveille avec les viandes rouges charcuteries et fromage', NULL, '2023-05-18 18:29:11', 0, 24, 12, NULL, NULL, NULL, 52, 17),
(128, 'BT 75CL AOP ST JOSEPH ROUGE LES PETITS CAILLOUX', 24500, 30000, 30000, '64259a7a580dd-1680185978.jpg', '2023-03-30 10:19:38', 200, 0, 'Les côtes rouges  Millésime 2018  cépages:100 % Syrah  75cl  T°de service:18°  Dégustations:   Vin de couleur rouge très intense.Le Premier nez très expressif avec des arômes épices et de fruit rouge très mûr. La bouche est élégante et longue aux tanins fondus.  Accords:  GibierMarrons grillés civet de marcassin,Magret de canard Tous types de fromages Chocolats', NULL, '2023-05-18 18:30:17', 0, 24, 12, NULL, NULL, NULL, 52, 17),
