(132, 'BT 75CL AOP COTES DE PROVENCE ROSE 1902', 15500, 20000, 20000, '6425a21e2eb44-1680187934.jpg', '2023-03-30 10:52:14', 200, 0, 'Ce Viognier de la gamme le versant accompagnera à merveille vos viandes blanches et vos poissons. Il a une robe brillante aux reflets verts, un nez intense d\'abricot, de rose et d\'acacia. Légère note fumée et grillée. Ce vin de pays d\'oc à une bouche puissante avec un bon équilibre et une persistance aromatique remarquable.  Servir frais à 10 °C.', NULL, '2023-05-19 07:38:19', 0, 24, 13, NULL, NULL, NULL, 52, 17),
