(141, 'BT 75CL CHÂTEAU LOUDENNE BORDEAU BLANC 6/75CL ', 19000, 25000, 25000, '6425a3e99a09f-1680188393.webp', '2023-03-30 10:59:53', 200, 0, 'LOUDENNE poursuit sa démarche pour la protection de l’environnement avec Les Jardins, une gamme de vins biologiques, créés en partenariat avec des viticulteurs de la région de Bordeaux. LOUDENNE propose à travers Les Jardins des vins qui expriment sans artifice la typicité des cépages et du terroir de Bordeaux.', NULL, '2023-05-18 18:35:03', 0, 24, 13, NULL, NULL, NULL, 52, 17),
