(150, 'Baccarat Rouge 200mL', 400000, 450000, 450000, NULL, '2023-03-30 11:04:41', 850, 0, 'Baccarat Rouge 540 est né de la rencontre de Maison Francis Kurkdjian et de la cristallerie Baccarat, dont cette eau de parfum célèbre les 250 ans. Le parfum boisé dégage une alchimie poétique, une signature olfactive graphique et condensée à l’extrême. Les facettes aériennes du jasmin et l’éclat du safran transportent les notes minérales de l’ambre gris et les tonalités boisées d’un cèdre fraîchement coupé. Lumineux et racé, Baccarat Rouge 540 eau de parfum se pose sur la peau tel un souffle fleuri ambré et boisé.', NULL, '2023-03-30 11:04:41', 0, 18, 10, NULL, NULL, NULL, 53, 16),
(151, 'Sauvage Dior', 50000, 75000, 75000, NULL, '2023-03-30 11:05:22', 850, 0, 'L’eau de parfum Sauvage de Dior est une fragrance masculine inspirée du désert à l’heure du soleil couchant. À travers Sauvage Eau de Parfum, la maison Dior a sélectionné une vanille d’exception originaire de Papouasie-Nouvelle-Guinée. Sur un fond boisé ambré, elle diffuse son exotisme gourmand et donne à Sauvage des accents orientaux sensuels', NULL, '2023-05-15 10:31:42', 0, 18, 10, 7, NULL, NULL, NULL, 16),
(152, 'COCO Mademoiselle Chanel 200mL', 100000, 125000, 125000, NULL, '2023-03-30 11:06:22', 850, 0, 'L’essence d’une femme libre et audacieuse. Un oriental féminin au caractère affirmé et pourtant d’une étonnante fraîcheur. COCO MADEMOISELLE puise son inspiration dans la personnalité hors du commun de Gabrielle Chanel. La fragrance s’affirme comme l’écho olfactif d’un esprit indépendant qui s’affranchit des codes pour mieux créer les siens. Le portrait d’une femme prête à écrire sa destinée avec audace.', NULL, '2023-03-30 11:06:22', 0, 16, 10, 8, NULL, NULL, 53, 16),
(153, 'N5 Chanel 200mL', 50000, 70000, 70000, NULL, '2023-03-30 11:07:16', 850, 0, 'L’essence de la féminité, un sublime parfum floral aldéhyde laissant une ligne minimaliste au flacon ionique. N5 de chanel est un parfum mystérieux et intemporel.', NULL, '2023-03-30 11:07:16', 0, 16, 10, 8, NULL, NULL, NULL, 16),
(154, 'Djessy Aroma N15 30mL', 4000, 7500, 7500, NULL, '2023-03-30 11:07:55', 842, 0, 'Djessy Aroma N15 30mL', NULL, '2023-06-23 13:44:53', 0, 18, 10, NULL, 14, NULL, 53, 16),
(155, 'Djessy Aroma N5 30mL', 4000, 7500, 7500, NULL, '2023-03-30 11:08:34', 850, 0, 'Djessy Aroma N5 30mL', NULL, '2023-03-30 11:08:34', 0, 18, 10, NULL, 14, NULL, 53, 16),
(156, 'Twily d\'Hermès 85mL', 70000, 90000, 90000, NULL, '2023-03-30 11:09:39', 850, 0, 'Le parfum de la fille d’Hermès, un parfum qui mêle l’insolence du gingembre mordant a l’inquiétude tubéreuse. Un parfum floral oriental.', NULL, '2023-03-30 11:09:39', 0, 18, 10, 6, NULL, NULL, NULL, 16),
(157, 'BT 75CL CHÂTEAU TERTRE DE COURBAN 2015', 12000, 17000, 17000, '6425a6516d9a6-1680189009.jpg', '2023-03-30 11:10:09', 200, 0, 'Vin français Château Tertre de Courban Bordeaux Supérieur 2015 – 750mlIl est étiqueté d\'une étiquette bronze qui lui donne un côté millésimé et c\'est un vin qui se sent vieilli et c\'est un vin français supérieur aux vins de Bordeaux réguliers car le Bordeaux Supérieur standard a un arôme complexe et attractif.Plus que les vins de Bordeaux conventionnels, et surtout en vertu de la législation française sur le vin, les raisins utilisés dans la production du Château français Tertra de Courban sont strictement contrôlés, ce qui entraîne de faibles rendements en raisins. Château Tertre de Courban est un vin rouge audacieux plein de personnalité avec de riches saveurs de fruits rouges mûrs. Sa saveur est un complexe de raisins secs, d\'herbe brûlée et de raisins spéciaux de la région bordelaise de la France rêveuse. Prenez la saveur principale du raisin, avec des raisins sélectionnés parmi de nombreux cépages différents, vieillis pendant plusieurs mois pour atteindre la saveur la plus délicieuse.', NULL, '2023-05-19 07:40:24', 0, 24, 12, NULL, NULL, NULL, 52, 17),
(158, 'Vaporisateur de parfum', 7500, 15000, 15000, NULL, '2023-03-30 11:12:50', 850, 0, 'Vaporisateur de parfum', NULL, '2023-03-30 11:12:50', 0, 22, 11, NULL, NULL, NULL, 53, 16),
(159, 'Vaporisateur de parfum', 15000, 25000, 25000, NULL, '2023-03-30 11:13:41', 850, 0, 'Vaporisateur de parfum', NULL, '2023-03-30 11:13:41', 0, 22, 11, NULL, NULL, NULL, 53, 16),
