(161, 'BT 75CL CHÂTEAU HAUT DOMINGUE 2016', 12000, 17000, 17000, '6425a77e7f326-1680189310.webp', '2023-03-30 11:15:10', 200, 0, 'CHÂTEAU HAUT-DOMINGUE AOC BORDEAUX 2016 est un vin rouge de la région de Bordeaux. Ce vin est un assemblage de 3 cépages qui sont le Cabernet franc, le Cabernet-Sauvignon et le Merlot. En bouche ce vin rouge est un vin puissant avec un bel équilibre entre l’acidité et les tanins. Ce vin s’accorde généralement bien avec de la volaille, du boeuf ou du veau.  Ce millésime possède une meilleure note que toutes les autres années de ce vin.  Le Château Haut-Domingue fait parti des plus grands domaines au monde. Il propose 3 vins à la vente dans la région de Bordeaux à venir découvrir sur place ou à acheter en ligne. Il est dans le top 3 des meilleurs domaines de la région  CHÂTEAU HAUT-DOMINGUE AOC BORDEAUX 2016 :  Nez : Le Bordeaux du Château Haut-Domingue de la région de Bordeaux révèle souvent des types d’arômes d’évolution (vieillissement), terre ou boisé et parfois aussi des arômes d’épices, fruit rouge ou fruits noirs. Bouche : Ce vin rouge est un vin puissant avec un bel équilibre entre l’acidité et les tanins. Quantité : 75 cl', NULL, '2023-05-19 07:41:17', 0, 24, 12, NULL, NULL, NULL, 52, 17),
(162, 'BT 75CL CHÂTEAU ST FLORIN 2016', 13500, 18500, 18500, '6425a8181a581-1680189464.jpg', '2023-03-30 11:17:44', 200, 0, 'Château Saint-Florin - Rouge - 2016 :L’encépagement du Château Saint Florin est composé de 60 % merlot, 20 % cabernet sauvignon et 20% cabernet franc. La vinification est parcellaire. Les vignes pour le vin rouge ont une moyenne d\'âge de 25 ans tandis qu\'elle ont une moyenne d\'âge de 20 ans pour le vin blanc.', NULL, '2023-05-19 07:42:27', 0, 24, 12, NULL, NULL, NULL, 52, 17),
(163, 'BT 75CL CHÂTEAU LES VALLEES 2015', 14000, 19000, 19000, '6425a88f506ad-1680189583.jpg', '2023-03-30 11:19:43', 200, 0, 'Château Les Vallées - Rouge - 2015 : Possède une belle robe pourpre. Un nez qui révèle des arômes riches, intenses avec de belles notes de cassis. En bouche, l\'attaque ample et ronde reste en harmonie avec le fruit. Ce vin de style très classique est structuré et bien équilibré avec une finale persistante fruitée, épicée, au plaisir immédiat.', NULL, '2023-05-19 07:43:48', 0, 24, 12, NULL, NULL, NULL, 52, 17),
(164, 'BT 75CL CHÂTEAU GADET CUYPERS 2014', 15000, 20000, 20000, '6425a9425a640-1680189762.jpg', '2023-03-30 11:22:42', 200, 0, 'Cette propriété appartenant à la famille Reich a été créée en 2006 à partir d’un petit vignoble dans le domaine de Begadan. Ce vignoble d’une petite superficie de 3 hectares est situé sur un sol argilo-sableux et un sous sol argilo-calcaire.', NULL, '2023-05-19 07:44:50', 0, 24, 12, NULL, NULL, NULL, 52, 17),
(165, 'OLMECA GOLD 38% 12/1L', 28500, 35000, 35000, '642c5f30776a6-1680629552.png', '2023-03-30 11:28:31', 200, 0, 'Olmeca Tequila Gold est vieillie pendant plus d\'un an en fûts de chêne et est fabriquée à partir d\'agave bleu. Selon la légende, le nectar de l\'agave bleu était bu par les dieux du peuple ', NULL, '2023-05-19 07:46:16', 0, 25, NULL, NULL, NULL, NULL, 52, 17),
(166, 'PATRON REPOSADO 40% 6/1L', 65000, 70000, 70000, '642c5f451ea19-1680629573.jpeg', '2023-03-30 11:39:02', 200, 0, ' Couleur : Or clair. Nez : Doux, robuste, légèrement sec, agrume. Goût : corsé, agrumes. Finition : Longue durée. Parfait comme cadeau Interdiction de vente de boissons alcooliques aux mineurs de moins de 18 ans - Code de la santé publique, Art. L.3342-1 et L.3353-3. L’abus d’alcool est dangereux pour la santé. A consommer avec modératio', NULL, '2023-05-19 07:47:05', 0, 25, NULL, NULL, NULL, NULL, 52, 17);
