(326, 'Huawei P20 pro ', 50000, 90000, 90000, NULL, '2023-04-17 09:12:32', 5, 25, 'Hu', NULL, '2023-06-22 11:37:04', 0, NULL, NULL, NULL, NULL, NULL, 212, 20),
