(329, 'RT', 500, 1000, 1500, NULL, '2023-04-17 11:31:53', 0, 0, 'FGFG', NULL, '2023-05-16 08:27:49', 0, NULL, NULL, NULL, NULL, NULL, NULL, 16),
(330, 'Savon Marseille', 1000, 2000, 1500, '6440013fae2ac-1681916223.png', '2023-04-19 10:57:03', 56, 110, 'Savon pour corp', NULL, '2023-05-31 06:58:31', 0, 34, NULL, NULL, NULL, NULL, 69, 20),
(331, 'Very irrésistible 250ml', 9000, 15000, 10000, NULL, '2023-04-19 12:57:28', 1, 0, 'Bien plus qu\'une simple essence, il est le symbole d\'un état d\'esprit, d\'un sourire ou même d\'un coup de foudre. Spontané et audacieux tout en étant terriblement sensuel, Very Irresistible Eau de Parfum est un parfait témoignage de l\'attachement d\'Hubert de Givenchy vis-à-vis des femmes.', NULL, '2023-04-20 11:17:44', 0, 35, 20, NULL, NULL, NULL, 105, 22),
(332, 'Scandalous 250ml', 9000, 15000, 10000, NULL, '2023-04-19 13:01:49', 6, 0, 'Une odeur tres sucré de menthe qui vire au malabar... Excellent parfum a porter par beau temps et que j\'ai vider en meme pas deux ans mais qui a malheureusement... C\'est agréable de lire une critique de la rédaction quand elle traduit franchement le ressenti de l\'auteur.', NULL, '2023-04-20 11:17:14', 0, 35, 20, NULL, NULL, NULL, 105, 22),
(333, 'Femme hugo boss 100 ml', 7000, 10000, 8500, NULL, '2023-04-19 13:01:56', 17, 0, 'Bien plus qu\'un simple parfum, Boss Femme est un hymne à la féminité. Il nous dépeint l\'image d\'une personne radieuse, souriante et sereine. Boss Femme laisse flotter derrière lui un souffle tendre et apaisant. Il est un concentré de bonheur et de féerie. Avec lui, la femme apparaît sous ses plus belles facettes, à la fois romantique, intuitive et presque magique. Boss Femme est une fragrance tendre qui ne contribue qu\'à faire rayonner celle qui la porte. Boss Femme a été idéalement pensé pour sublimer les sentiments. Son sillage est parfois velouté, quelque peu mystérieux et toujours subtil. Il s\'agit d\'un jus qui invite à un rapprochement. Boss Femme est une essence que l\'on pourrait décrire de la sorte : à la fois douce, amoureuse, sensuelle, généreuse et lumineuse. Sa modernité traduit le tempérament d\'une femme actuelle mais son romantisme et l\'amour font de ce jus un intemporel.', NULL, '2023-04-19 13:01:56', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(334, 'Narciso Rodriguez 250ml', 9000, 15000, 10000, NULL, '2023-04-19 13:03:45', 2, 0, 'La Senteur est juste incroyable. Il tient très bien la journée surtout quand on le vaporise sur les vêtements. Plus la journée passe, plus la senteur se bonifie. C\'est un parfum que j\'aime porter souvent et surtout quand j\'ai besoin d\'un petit coup de boost olfactif.', NULL, '2023-04-20 11:16:22', 0, 35, 20, NULL, NULL, NULL, 105, 22),
(335, 'Poison Girl C.dior 100ml', 7000, 10000, 8500, NULL, '2023-04-19 13:04:16', 5, 0, 'Poison Girl de Dior est un parfum Ambre Vanillé pour femme. Poison Girl a été lancé en 2016. Le nez derrière ce parfum est Francois Demachy. Les notes de tête sont Bigarade et Citron; les notes de coeur sont Rose de Damas, Rose de Grasse et Fleur d\'oranger; les notes de fond sont Vanille, Amande, Fève de tonka, Baume de Tolu, Bois de santal, Bois de cachemire et Héliotrope.', NULL, '2023-04-20 10:46:02', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(336, 'Black Opium 250ml', 9000, 15000, 10000, NULL, '2023-04-19 13:04:40', 6, 0, 'Je possède un autre parfum de la gamme Black Opium et je préfère de loin celui-là. J\'ai beaucoup aimé sa pointe de café qui donne du caractère au parfum et ses notes de vanille qui viennent l\'adoucir. Le flacon est beau avec toutes ses paillettes, il donne un côté pétillant et une envie de le porter en soirée.', NULL, '2023-04-20 11:16:01', 0, 35, 20, NULL, NULL, NULL, 105, 22),
(337, 'Kouros Body 250ml', 9000, 15000, 10000, NULL, '2023-04-19 13:05:39', 5, 0, 'Celui-ci est une parfaite alliance de corps sculptural et d\'esprit réfléchi. Ne vous fiez pas à sa silhouette de rêve, il cache également une tête bien pleine ! Body Kouros devient aussitôt une représentation de l\'être parfait, véritable fantasme pour les femmes et idéal à atteindre pour les homme', NULL, '2023-04-20 11:15:21', 0, 35, 20, NULL, NULL, NULL, 105, 22),
(338, 'Ange ou Demon Givenchy 100ml', 7000, 10000, 8500, NULL, '2023-04-19 13:06:04', 16, 0, 'Ce nouveau parfum féminin signé Givenchy, est une énigme.  Cette femme est-elle un ange dont l\'harmonie vous attire ou un démon dont les illusions vous piègent ?  Son flacon est une pampille. Il est l\'ombre et la lumière, de l\'éclat du cristal à la profondeur du noir.  La fragrance célèbre la rencontre de la fleur de lys, pure et noble et du bois de chêne dense et profond.  Ce philtre magique au charme envoûtant est à la fois lumineux, pur et mystérieux..', NULL, '2023-04-20 10:46:48', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(339, 'Le Male 250ml', 9000, 15000, 10000, NULL, '2023-04-19 13:07:37', 2, 0, 'Ce déodorant fait ce qu\'on lui demande, il est efficace toute la journée! le parfum est léger et sympathique,', NULL, '2023-04-20 11:15:03', 0, 35, 20, NULL, NULL, NULL, 105, 22),
(340, 'Intense armani 100 ml', 7000, 10000, 8500, NULL, '2023-04-19 13:07:46', 8, 0, ' Il est d\'usage de considérer que l\'eau de toilette contient de 7 à 12% de parfum ou d\'huile de parfum dans la formule, l\'eau de parfum en contient de 10-14%, et que l\'eau de parfum Intense entre 14 et 25%.', NULL, '2023-04-20 10:47:11', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(341, 'Calvin Klein  One Women 100ml', 7500, 10000, 8500, NULL, '2023-04-19 13:09:09', 19, 0, 'Le véritable succès planétaire des années 90, le parfum pour femme Ck One de Calvin Klein est devenu l\'un des best-sellers de cette enseigne. Celui-ci est considéré par beaucoup comme une sorte d’Eau de Cologne moderne', NULL, '2023-04-20 10:47:50', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(342, 'Vanille Élégante 250ml', 9000, 15000, 10000, NULL, '2023-04-19 13:09:42', 1, 0, 'Réveillez vos textiles avec les désodorisants textiles RP. Le Désodorisant Textile RP est une bouffée d’air frais pour les tissus.  EN STOCK  quantité de VANILLE ÉLÉGANTE 1  AJOUTER AU PANIER', NULL, '2023-04-20 11:14:44', 0, 35, 20, NULL, NULL, NULL, 105, 22),
(343, 'Alien 250ml', 9000, 15000, 10000, NULL, '2023-04-19 13:10:27', 2, 0, 'Cette eau de parfum est pleine de mystère et de sensualité. Ses notes délicatement fleuries vous feront vibrer de plaisir. Son flacon, facetté comme une pierre précieuse, renferme une fragrance mystérieuse à l\'aura rayonnante. Ce parfum est entouré d\'une aura particulière, qui fait d\'Alien un parfum unique.', NULL, '2023-04-20 11:14:25', 0, 35, 20, NULL, NULL, NULL, 105, 22),
(344, 'Scandal Y-S 100ml', 7000, 10000, 8000, NULL, '2023-04-19 13:11:12', 1, 0, 'sCANDAL Y-S', NULL, '2023-04-20 10:48:09', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(345, 'Flowerbomb Viktor Rolf 250ml', 9000, 15000, 10000, NULL, '2023-04-19 13:12:11', 3, 0, 'Ce produit est parmi mes parfums préférés, il est envoûtant pétillant et il sent tellement bon que je me sens toujours bien quand je le porte. Il tient des heures et il ne perd pas son odeur et sa fraîcheur. Je recommande ce parfum.', NULL, '2023-04-24 05:37:06', 0, 35, 20, NULL, NULL, NULL, 105, 22),
(346, 'Sauvage 250ml', 9000, 15000, 10000, NULL, '2023-04-19 13:12:57', 7, 0, 'Sauvage Parfum est décrit comme un jus plus intense. En réalité, il offre surtout une attraction plus animale et une senteur plus ronde et ensorcelante. Résultat : le pari de Dior est brillamment remporté ! Avec lui, oubliez les parfums trop épicés et entêtants.', NULL, '2023-04-20 11:13:47', 0, 35, 20, NULL, NULL, NULL, 105, 22),
(347, 'Good Girl 250ml', 9000, 15000, 10000, NULL, '2023-04-19 13:13:57', 7, 0, 'Good Girl de Carolina Herrera est un parfum tenace et très équilibré. D\'un côté, il offre quelques senteurs délicates et très féminines. Par exemple, il s\'articule autour de la tubéreuse narcotique, de l\'amande gourmande et du jasmin miellé et fruité.', NULL, '2023-04-20 11:13:28', 0, 35, 20, NULL, NULL, NULL, 105, 22),
(348, 'La nuit du trésor lancome 100ml', 7000, 10000, 8500, NULL, '2023-04-19 13:13:59', 5, 0, 'Parfum floral sensuel pour les femmes qui ont confiance en elles; idéal pour accompagner les tenues de soirée et lors des occasions spéciales.  L’eau de parfum pour femmes Boss Nuit de la marque Hugo Boss; propose une expérience olfactive séduisante et enivrante qui évoque une nuit magique et tout le mystère qui l’entoure.', NULL, '2023-04-20 10:48:49', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(349, 'Venzo World 100ml', 7000, 1000, 8500, NULL, '2023-04-19 13:15:44', 31, 0, ' Un monde à leur image, audacieux, spontané, surprenant et coloré. Un monde qui prône la liberté d\'expression, la diversité et la créativité. Un parfum dynamique et joyeux, une nouvelle dimension de l\'esprit Kenzo.  Le nouveau parfum féminin Kenzo : un parfum floral et ambré. Comme un bouquet de rêve, la pivoine est sublimée pour accompagner les notes de « petits fruits rouges ', NULL, '2023-04-20 10:49:13', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(350, 'Black XS L\'Excès 250ml', 9000, 15000, 10000, NULL, '2023-04-19 13:16:09', 1, 0, 'Eau de parfum en spray de 80ml. Ce parfum rock est intense, glamour, sensuel et vibrant. Ce floral oriental incarne la femme glamour et sensuelle. Les premières notes électrisent avec le néroli et le poivre noir. Le cœur lui, est composé de rose et de Jasmin.', NULL, '2023-04-20 11:13:12', 0, 35, 20, NULL, NULL, NULL, 105, 22),
(351, 'Miracle lancôme 100ml', 7000, 10000, 8500, NULL, '2023-04-19 13:17:30', 16, 0, 'La vie est un miracle. La composition vibrante et pétillante de Miracle, le parfum Lancôme, s\'éveille telle l\'aube d\'un nouveau jour sur un bouquet de lychee et de freesia baigné de rosée.  Son cœur d\'épices se mêle aux notes de magnolia, jasmin, gingembre et poivre quand son sillage vous enveloppe dans la sensualité de l\'ambre et du musc.', NULL, '2023-04-20 10:50:12', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(352, 'Jungle Kenzo 100ml', 7000, 10000, 8500, NULL, '2023-04-19 13:18:28', 12, 0, 'KENZO JUNGLE est un oriental épicé qui ne manque pas de caractère ! La Cardamome pimente un cœur gourmand d\'Ylang-Ylang, Réglisse et Gardénia sur un fond généreux de Patchouli. Un sillage sensuel, très signé.', NULL, '2023-04-20 10:49:49', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(353, 'Ports Girl 250ml', 9000, 15000, 10000, NULL, '2023-04-19 13:19:07', 2, 0, 'none', NULL, '2023-04-20 11:12:51', 0, 35, 20, NULL, NULL, NULL, 105, 22),
(354, 'La Vie est Belle  250ml', 9000, 15000, 10000, NULL, '2023-04-19 13:20:30', 6, 0, '« La Vie est Belle » débute par des senteurs fraiches et fruitées grâce à la présence de la poire et du cassis. Les fruits s\'associent ensuite à des notes aldéhydées pour encore plus de fraicheur. Le cœur est ultra gourmand et sensuel à souhait.', NULL, '2023-04-24 05:38:41', 0, 35, 20, NULL, NULL, NULL, 105, 22),
