(375, 'Eden cachorel 100ml', 7000, 10000, 8500, NULL, '2023-04-20 05:21:51', 6, 0, 'Ce parfum iconique de la maison Cacharel va vous transporter au paradis et dans le jardin d\'Eden. Le flacon :  Poli comme un galet de jade, chaque flacon est unique. En effet grâce à un procédé technique particulier, chaque flacon est veiné de manière à ce que sa forme et sa couleur ne soient jamais les mêmes.', NULL, '2023-04-20 10:52:59', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(376, 'Aura MUGLER 100ml', 7000, 10000, 8500, NULL, '2023-04-20 05:23:57', 2, 0, 'coutez votre instinct avec le parfum Aura MUGLER qui allie fraîcheur végétale et sensualité féline. Il capture les notes boisées, sauvages et charnelles de la nature dans son eau de parfum et son lait de corps. Le flacon vert émeraude, lumineux et puissant, incarne le cœur qui pulse et rythme la vie. Il est éternel grâce la recharge de parfum Aura. Aura MUGLER est un parfum pour femmes connectées à leur nature profonde, en quête d’authenticité et à la recherche de leur singularité. Oserez-vous l’incarner ? Avec la recharge de parfum Aura MUGLER, vous pouvez être sûre que votre parfum préféré sera éternellement à vos cotés.', NULL, '2023-04-20 10:53:27', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(377, 'Chloé Chloé 100ml', 7000, 10000, 8500, NULL, '2023-04-20 05:26:18', 16, 0, 'Chloé est une maison naturellement féminine engagée en faveur de la valorisation de la femme et de l\'inclusion. Dévoilant une rose lumineuse, cette Eau de Parfum pour femme Chloé est un parfum floral qui incarne à la perfection la femme Chloé: libre d’esprit, élégante, résolument féminine.  Née à Paris il y a près de 60 ans, la vision du charme naturel emblématique de Chloé se retrouve dans les collections de prêt-à-porter, d’accessoires et de parfums de la Maison. Unique et intemporel, ce parfum pour femme capture l’authentique puissance de la femme Chloé.', NULL, '2023-04-20 10:54:03', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(378, 'Manifesto Y-S 100ml', 7000, 10000, 8500, NULL, '2023-04-20 05:28:24', 5, 0, 'Le parfum floral et oriental pour une femme qui fixe ses propres règles.  L\'HISTOIRE Au-delà des conventions, le femme Manifesto par Yves Saint Laurent créée ses propres codes. Pour elle, rien de grand ne se vit sans passion. Un hommage perpétuel au style, à la beauté, au mystère, au vertige, à l\'excès et à la passion.', NULL, '2023-04-20 10:54:51', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(379, 'Infusion Iris Prada 100ml', 7000, 10000, 8500, NULL, '2023-04-20 05:29:50', 4, 0, 'Précieuse et insaisissable, Infusion Iris est une interprétation sensuelle d\'Iris, avec un mélange de mandarine d\'Italie, de néroli de Tunisie et de galbanum, un cœur d\'iris pallida et des notes de fond de bois de cèdre, de benjoin et d\'encens.  Code du produit: 1A1041_2HCQ_F0Z99_P_ML100 Notes : agrumes, florales, mandarine d\'Italie, néroli de Tunisie, lentisque, galbanum, iris pallida, boisées, ambrées, bois de cèdre, benjoin, encens 100 ml', NULL, '2023-04-20 10:55:15', 0, 35, 19, NULL, NULL, NULL, NULL, 22),
(380, 'Lody million Paco rabanne 100ml', 7000, 10000, 8500, NULL, '2023-04-20 05:31:55', 4, 0, 'Lody million Paco rabanne', NULL, '2023-04-20 10:56:56', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(381, 'Girl of now Elie soob 100ml', 7000, 10000, 8500, NULL, '2023-04-20 05:33:32', 1, 0, 'L\'esprit de la Girl of Now dans un parfum.  Une nouvelle Eau de Parfum florale et gourmande : Une note addictive d\'amande, facettée par la fleur d\'oranger & le patchouli, la signature de la marque.', NULL, '2023-04-20 10:57:26', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(382, 'Sorbetto Rosso de Escada 100ml', 7000, 10000, 8500, NULL, '2023-04-20 05:34:47', 25, 0, 'Sorbetto Rosso de Escada est un parfum Aromatique Fruité pour femme. Sorbetto Rosso a été lancé en 2018. Les notes de tête sont Poire, Calone et Tangerine; les notes de coeur sont Pastèque, Notes aquatiques, Fraise, Pomme, Sel de mer, Fleur de tiaré, Hedione et Rose; les notes de fond sont Praliné, Musc et Ambre.', NULL, '2023-04-20 10:57:44', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(383, 'idylle guerlain 100ml', 7000, 10000, 8500, NULL, '2023-04-20 05:36:01', 4, 0, 'idylle guerlain', NULL, '2023-04-20 10:58:04', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(384, 'Coco Noir Channel 100ml', 7000, 10000, 8500, NULL, '2023-04-20 05:37:05', 16, 0, 'Un ambré moderne aux notes lumineuses. En prélude, une envolée fusante et racée portée par la bergamote capte la curiosité. Riche de promesses, un cœur généreux dévoile peu à peu l\'éclatante sensualité de la rose et la note singulière de feuille de géranium rosat. Un sillage magnétique, dessiné par le patchouli et la fève tonka prolonge l\'intrigue.', NULL, '2023-04-20 10:58:24', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(385, 'Amor Amor Cacharel 100ml', 7000, 10000, 8500, NULL, '2023-04-20 05:39:21', 19, 0, ' Au sein de la maison Cacharel, chaque essence véhicule un message. Chaque parfum de marque est synonyme d\'émotions, de promesses et de déclarations. Aussi, comme le laisse à penser son nom et sa sublime couleur rouge, .', NULL, '2023-04-20 10:58:47', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(386, 'Miss Dior 100ml', 7000, 10000, 8500, NULL, '2023-04-20 05:40:00', 1, 0, 'Miss Dior', NULL, '2023-04-20 10:59:30', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(387, 'Paris Y-S 100ml', 7000, 10000, 8500, NULL, '2023-04-20 05:41:07', 10, 0, 'Paris Y-S', NULL, '2023-04-20 11:00:00', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(388, '5th Avenue d\'Elizabeth gorden 100ml', 7000, 10000, 8500, NULL, '2023-04-20 05:43:45', 17, 0, '5th Avenue d\'Elizabeth Arden est un parfum floral moderne, semi-oriental et classique américain. Le parfum 5th Avenue capture le style et l\'énergie de la célèbre 5th Avenue de New York.  Elizabeth Arden 5th Avenue est un classique américain contemporain depuis son lancement et est toujours très appréciée des femmes du monde entier. 5th Avenue a un parfum floral pétillant et frais, chaleureux et riche.  Notes de parfum de tête : lilas, fleur de tilleul, magnolia rosé, muguet, mandarine exotique et bergamote', NULL, '2023-04-20 11:00:39', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(389, 'Lolita Lempicka 100ml', 7000, 10000, 8500, NULL, '2023-04-20 05:45:02', 12, 0, 'Lolita Lempicka', NULL, '2023-04-20 11:01:01', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(390, 'Luna Nina Ricci 100ml', 7000, 10000, 8500, NULL, '2023-04-20 05:46:54', 3, 0, 'Les Belles de Nina signe le nouveau chapitre de la gourmandise avec un floral boisé gourmand.Une complicité unique où Luna fait écho à Nina. Un parfum féminin qui pour la première fois, combine une immortelle blanche avec une overdose de caramel.', NULL, '2023-04-20 11:01:33', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(391, 'Trésor lancôme 100ml', 7000, 10000, 8500, NULL, '2023-04-20 05:48:06', 35, 0, ' Ce parfum femme est l\'incarnation de l\'émotion de l\'amour absolu et éternel depuis 1990.', NULL, '2023-04-20 11:02:25', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(392, 'J’adore Dior 100ml', 7000, 10000, 8500, NULL, '2023-04-20 05:49:45', 20, 0, 'J’adore, l’ode aux femmes, à leur audace, à leur beauté. De l’eau de parfum J’adore au concentré de fleurs et d’eau de Parfum d’eau, l’iconique bouquet floral se révèle et se réinvente. Comme une prouesse d’équilibre où les plus belles fleurs s’expriment avec sensualité et fraicheur.', NULL, '2023-04-20 11:02:52', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(393, 'Agua Del Sol Escada 100ml', 7000, 10000, 8500, NULL, '2023-04-20 05:51:11', 2, 0, 'L\'été est de loin la saison que les gens préfèrent. En effet, hormis les grands amateurs de sports d\'hiver, tout le monde s\'accorde à dire que le soleil quotidien, les vacances et les petits déjeuners en terrasse sont autant d\'éléments qui donnent du baume au cœur.', NULL, '2023-04-20 11:03:15', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(394, 'Illicit Jimmy choo 100ml', 7000, 10000, 8500, NULL, '2023-04-20 05:52:30', 25, 0, 'if et provocant mais doté d’une douceur sous-jacente, Illicit est un floriental moderne à la signature envoûtante et naturellement féminine.  Une expérience olfactive totalement unique, où les nuances réconfortantes du gingembre flirtent avec les notes féminines de la rose et les nuances sophistiquées du jasmin, avant de s\'évaporer pour révéler la signature du parfum : un accord gourmand de miel et d’ambre.', NULL, '2023-04-20 11:03:35', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(395, 'Chance Chanel 100ml', 7000, 10000, 8500, NULL, '2023-04-20 05:53:55', 11, 0, 'Pour Gabrielle Chanel, la vraie chance est celle que l’on provoque, un état d’esprit, une façon d’être. Avec ses notes fleuries relevées par la baie rose, CHANCE entraîne dans un tourbillon de fantaisie. Imprévisible et toujours en mouvement, CHANCE prolonge son sillage avec LES NÉCESSAIRES DE CHANEL, des soins pour le corps et les cheveux.', NULL, '2023-04-20 05:53:55', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(396, 'Coco mademoiselle Channel 100ml', 7000, 10000, 8500, NULL, '2023-04-20 05:55:05', 6, 0, 'COCO MADEMOISELLE. Un ambré féminin au caractère affirmé d\'une étonnante fraîcheur. Un double nom qui évoque la double personnalité d’une femme espiègle et provocante, indépendante et attachante, libre de se réinventer. COCO MADEMOISELLE se décline en EAU DE PARFUM INTENSE, EAU DE PARFUM , EAU DE TOILETTE, EAU POUR LA NUIT, soins pour le corps et vaporisateurs de sac.', NULL, '2023-04-20 11:04:51', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(397, 'Habit Rouge Guerlin 100ml', 7000, 10000, 8500, NULL, '2023-04-20 05:57:12', 10, 0, 'L\'élégance a toutes les libertés Intensité', NULL, '2023-04-20 05:57:12', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(398, 'Cinéma Yves Saint Laurent 100ml', 7000, 10000, 8500, NULL, '2023-04-20 05:58:31', 10, 0, 'Cinéma a été lancé en 2004. Le nez derrière ce parfum est Jacques Cavallier. Les notes de tête sont Fleur d\'amandier, Clémentine et Cyclamen; les notes de coeur sont Jasmin, Pivoine et Amaryllis; les notes de fond sont Vanille, Ambre, Benjoin et Musc blanc.', NULL, '2023-04-20 11:05:54', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(399, 'Poême lancôme 100ml', 7000, 10000, 8500, NULL, '2023-04-20 05:59:43', 17, 0, 'Poême lancôme', NULL, '2023-04-20 11:08:11', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(400, 'La belle Jean Paul Gaultier 100ml', 7000, 10000, 8500, NULL, '2023-04-20 06:01:12', 28, 0, 'Laissez-vous séduire par l\'intensité du nouveau parfum féminin de Jean-Paul Gaultier : La Belle le Parfum. Plongez-vous dans un univers sensoriel ultra-féminin, où tous les péchés sont permis. L\'Eau de Parfum La Belle le Parfum de Jean-Paul Gaultier vous transporte par sa sensualité décomplexée. Son flacon rehaussé de roses or renferme des notes orientales fruitées qui vous accompagnent tout au long de la journée avec élégance. Découvrez La Belle le Parfum de Jean-Paul Gaultier, votre atout séduction. Cédez à la tentation !', NULL, '2023-04-20 11:08:48', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(401, 'LA PETITE ROBE NOIRE GUERLIN', 7000, 10000, 8500, NULL, '2023-04-20 06:03:02', 16, 0, 'Inspirée par le style inimitable des Parisiennes, La Petite Robe Noire est un hymne à la liberté et à l\'amour, une incarnation de l\'élégance et de l\'allure, une invitation à la joie de vivre et à l\'irrévérence. Un sillage de caractère brodé des plus belles notes noires de la parfumerie. Rendez votre parfum unique et profitez d’une gravure personnalisée offerte.', NULL, '2023-04-20 06:03:02', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(402, 'Black Opium Y-S 100ml', 7000, 10000, 8500, NULL, '2023-04-20 06:04:22', 21, 0, 'Vivre sa vie au superlatif… Suivre ses envies et son instinct, briser les codes et assumer sa singularité. Icône puissante et femme indépendante à la beauté magnétique, la femme Black Opium dessine sa vie selon ses propres règles. Charismatique et sensuelle, elle éveille à son passage un désir incontrôlable. Succombez à son appel. Laissez-vous hypnotiser par BLACK OPIUM.', NULL, '2023-04-20 11:09:38', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(403, 'LIBRE Y-S 100ml', 7000, 10000, 8500, NULL, '2023-04-20 06:08:11', 25, 0, 'LIBRE, l\'Eau de Parfum iconique par Yves Saint Laurent. Une lavande florale, sensuelle et audacieuse. Le sillage d\'une femme brûlant la vie par les deux bouts.  L’HISTOIRE L\'Eau de Parfum LIBRE par Yves Saint Laurent, pour une femme forte et audacieuse, qui revendique sa liberté. Une liberté brûlante. Sans compromis. Sans limite.  Un parfum comme un cri de liberté.', NULL, '2023-04-20 11:09:58', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(404, 'Olympia paco-rabanne 100ml', 7000, 10000, 8500, NULL, '2023-04-20 06:10:34', 13, 0, 'Olympia paco-rabanne', NULL, '2023-04-20 11:10:17', 0, 35, 19, NULL, NULL, NULL, 105, 22),
