(452, 'Hypnose Poison 250ml', 9000, 15000, 10000, NULL, '2023-04-20 06:50:02', 4, 0, 'Le flacon est magnifique, une sublime pomme rouge sombre. Il est extrêmement qualitatif jusque dans les moindres détails comme les initiales gravées de la marque. La fragrance est puissante, orientale et très sensuelle. C\'est un parfum sucré de part ses notes de vanille.', NULL, '2023-04-20 11:11:51', 0, 35, 20, NULL, NULL, NULL, 105, 22),
(453, 'Invectus +wanted 100ml', 7000, 10000, 8500, NULL, '2023-04-20 06:50:13', 15, 0, '100ml homme', NULL, '2023-04-20 11:31:40', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(454, 'Cristol Oud  50ml', 3750, 5000, 4500, NULL, '2023-04-20 06:50:34', 1, 0, 'Aucune description', NULL, '2023-04-20 11:34:30', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(455, 'Bleu Channel 100ml', 7000, 10000, 8500, NULL, '2023-04-20 06:50:56', 4, 0, '100ml homme', NULL, '2023-04-24 05:51:18', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(456, 'Pour homme Meuboussin 50ml', 3750, 5000, 4500, NULL, '2023-04-20 06:51:19', 3, 0, 'Aucune description', NULL, '2023-04-20 11:35:01', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(457, 'Dior Addict 250ml', 9000, 15000, 10000, NULL, '2023-04-20 06:51:24', 2, 0, 'L\'eau de parfum Dior Addict est une fragrance aux notes fleuries et fruitées. Une composition olfactive fraîche et attirante où l\'essence de mandarine se mêle à la fleur d’oranger.  Intense et vibrante, l\'eau de parfum dévoile en note de cœur l\'absolu jasmin sambac qui s\'estompe avec volupté, révélant une douceur féminine. En note de fond, se déploie la chaleur profonde de la vanille Bourbon.  Ce sillage à la fois doux et séducteur transporte celle qui la porte dans un tourbillon olfactif enivrant.  « Dior Addict est un parfum qui se pose là, instantanément, immédiatement. Il est généreux sans être opulent, séduisant sans être trop démonstratif. » François Demachy, Parfumeur-Créateur Dior', NULL, '2023-04-20 11:11:36', 0, 35, 20, NULL, NULL, NULL, 105, 22),
(458, 'Legende Mon blanc Givenchy  100ml', 7000, 10000, 8500, NULL, '2023-04-20 06:51:43', 1, 0, '100ml homme', NULL, '2023-04-20 11:32:32', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(459, 'Coco Chanel 250ml', 9000, 15000, 10000, NULL, '2023-04-20 06:52:10', 1, 0, 'Un superbe oriental qui ne sent pas la cocotte, un pur plaisir! La 1ère fois que j\'ai senti ce parfum, je l\'ai trouvé beaucoup trop fort et pas du tout à mon goût. Et puis en découvrant combien toute sa subtilité et ses notes se révèlent au fil des heures, j\'ai craqué.', NULL, '2023-04-20 11:11:20', 0, 35, 20, NULL, NULL, NULL, 105, 22),
(460, 'Pout Lui  in Black', 3750, 5000, 4500, NULL, '2023-04-20 06:52:13', 3, 0, 'Aucune description', NULL, '2023-04-20 06:52:13', 0, 35, 19, NULL, NULL, NULL, 105, 22),
