(465, 'Coton de Pekin 250ml', 9000, 15000, 10000, NULL, '2023-04-20 06:54:03', 2, 0, 'Les parfums d\'ambiance Maison Maïssa Parfums Paris sont des fragrances uniques qui donneront vie à votre intérieur et à votre linge.  Vivez une expérience sensorielle unique avec Maison Maïssa Parfums Paris.', NULL, '2023-04-20 11:10:59', 0, 35, 20, NULL, NULL, NULL, 105, 22),
(466, 'Explorer Mont Blanc 100ml', 7000, 10000, 8500, NULL, '2023-04-20 06:54:39', 2, 0, '100ml homme', NULL, '2023-04-20 11:34:50', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(467, 'Acqua di Gio 250ml', 9000, 15000, 10000, NULL, '2023-04-20 06:55:06', 2, 0, 'Acqua di Gio Eau de parfum Giorgio Armani est dans la lignée des autres opus de la gamme. Cette relecture 2022 est plutôt réussie. Elle dévoile une olfaction élégante et masculine. Nous retrouvons bien entendu les notes marines, mais aussi les agrumes, le tout relevé par une belle minéralité.', NULL, '2023-04-20 11:10:27', 0, 35, 20, NULL, NULL, NULL, 105, 22),
(468, 'Le Male JPG 100ml', 7000, 10000, 8500, NULL, '2023-04-20 06:55:19', 19, 0, '100ml homme', NULL, '2023-04-20 11:35:19', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(469, 'Scandal 250ml', 9000, 15000, 10000, NULL, '2023-04-20 06:55:52', 2, 0, 'En réalité, Scandal est un parfum très audacieux qui ne manque en rien de créativité. En effet, il retravaille la gourmandise sous un aspect résolument moderne. Il ose des associations inédites et place d\'ailleurs le miel au centre de sa composition, chose suffisamment rare pour être soulignée.', NULL, '2023-04-20 11:18:35', 0, 35, 20, NULL, NULL, NULL, 105, 22),
(470, 'Y-YSL 100ml', 7000, 10000, 8500, NULL, '2023-04-20 06:55:57', 4, 0, '100ml homme', NULL, '2023-04-20 11:36:07', 0, 35, 19, NULL, NULL, NULL, 105, 22),
