(474, 'La Petite Robe noire 250ml', 9000, 15000, 10000, NULL, '2023-04-20 06:59:38', 3, 0, 'Je suis absolument indispensable et totalement irrésistible. Je suis la création parfumée Guerlain chic et terriblement glamour. Ma fragrance est une broderie des plus belles notes ', NULL, '2023-04-20 11:09:15', 0, 35, 20, NULL, NULL, NULL, 105, 22),
