(476, 'Mon Paris YSL 250ml', 9000, 15000, 10000, NULL, '2023-04-20 07:00:45', 3, 0, 'Parfum très agréable à porter, adopté depuis des années, il sent super bon et tient toute la journée. Je ne peux pas m\'en passer. C\'est l\'un de mes parfums favoris, correspondanr parfaitement à mes goûts. Il est sublime.', NULL, '2023-04-20 11:09:45', 0, 35, 20, NULL, NULL, NULL, 105, 22),
(477, 'Drakkar Noir, Parfum Homme, Guy Laroche 100ml', 7000, 10000, 8500, NULL, '2023-04-20 07:02:30', 20, 0, '100ml homme', NULL, '2023-04-20 11:43:08', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(478, 'Musc Neige RP 250ml', 9000, 15000, 10000, NULL, '2023-04-20 07:02:30', 1, 0, 'Musc Tahara Dans notre gamme de parfums d’intérieur, venez découvrir le spray textile musc neige de la fameuse marque Rp Parfums ! Ce parfum d’intérieur saura redonner fraîcheur et aspect de propreté à vos tissus, mais également à votre maison. Laissez-vous tenter par sa senteur délicate et relaxante.', NULL, '2023-04-20 11:10:04', 0, 35, 20, NULL, NULL, NULL, 105, 22),
