(493, 'Girl of Now - Eau de Parfum de ELIE SAAB', 7000, 10000, 8500, NULL, '2023-04-20 07:18:04', 1, 0, '100ml homme', NULL, '2023-04-20 07:18:04', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(494, 'Givenchy 100ml', 7000, 10000, 8500, NULL, '2023-04-20 07:19:34', 4, 0, 'Tous vos avis sur L\'Interdit Eau de Parfum de Givenchy Il est très élégant et simple, aux courbes épurées et très féminin. L\'étui est très chic. J\'aime aussi la couleur du parfum. J\'aime beaucoup les premières notes de gingembre et d\'orange sanguine qui rende l\'odeur très fraîche et épicé.', NULL, '2023-04-20 12:01:04', 0, 35, 20, NULL, NULL, NULL, 105, 22),
(495, 'Declarcorher 100ml', 7000, 10000, 8500, NULL, '2023-04-20 07:20:55', 12, 0, 'none', NULL, '2023-04-24 06:04:15', 0, 35, 20, NULL, NULL, NULL, 105, 22),
(496, 'L\'Extase Eau De Parfum Nina Ricci', 7000, 10000, 8500, NULL, '2023-04-20 07:20:57', 4, 0, '100ml femme', NULL, '2023-04-20 07:20:57', 0, 35, 19, NULL, NULL, NULL, 105, 22),
(497, 'Aventus Creed 100ml', 7000, 10000, 8500, NULL, '2023-04-20 07:22:17', 6, 0, 'Aventus est un parfum à la fois puissant, conquérant et aérien comme un chevalier des temps modernes où des effluves herbacés côtoient Bergamote, Cassis, Pomme et Ananas en tête.  Avec des arômes Patchouli, de Bouleau, de Jasmin et de Baies Roses de la Réunion, le coeur souligne un tempérament aventureux tandis que l\'Ambre Gris, la Vanille et la Mousse de Chêne exhalent beaucoup de sensualité en fond.', NULL, '2023-04-20 12:01:39', 0, 35, 20, NULL, NULL, NULL, 105, 22),
(498, 'La Coste Boooster Lacoste 100ml', 7000, 10000, 8500, NULL, '2023-04-20 07:24:33', 7, 0, 'Un parfum qui sent bon la fraicheur. Son odeur est plutôt verte, comme la couleur du bouchon du flacon et de l\'emballage. Point fort: un bon parfum à porter au quotidien pous sentir bon mais de manière assez discrète point faible: le flacon est trop banal.', NULL, '2023-04-24 06:19:53', 0, 35, 20, NULL, NULL, NULL, 105, 22),
(499, 'Aqva Bvlgari 100ml', 7000, 10000, 8500, NULL, '2023-04-20 07:26:27', 2, 0, 'Aqva pour Homme, la nouvelle eau de toilette pour homme signée Bvlgari. Une fragrance fraîche, aromatique, aquatique alliant des notes marines naturelles et des accords minéraux nobles.', NULL, '2023-04-20 12:02:44', 0, 35, 20, NULL, NULL, NULL, 105, 22),
(500, ' Pour Lui In Black Mauboussin 100ml', 7000, 10000, 8500, NULL, '2023-04-20 07:28:32', 9, 0, 'Une eau de parfum sensuelle et puissante qui joue sur les codes de la virilité et de la séduction signée Mauboussin parfums. Une fragrance qui évolue dans la profondeur des pétales de violette noire ; vit au travers des éclats de menthe fraîche et perdure dans la force des essences du bois de gaïac.', NULL, '2023-04-20 12:03:04', 0, 35, 20, NULL, NULL, NULL, 105, 22),
(501, 'Bonjour Hugo Boss 100ml', 7000, 10000, 8500, NULL, '2023-04-20 07:30:08', 14, 0, 'Hugo fut un des premiers masculins à exploiter les notes fruitées, et amener ainsi une nouvelle fraîcheur, plus propre, plus fusante, dans la parfumerie masculine.', NULL, '2023-04-20 12:04:21', 0, 35, 20, NULL, NULL, NULL, 105, 22),
(502, 'Boss Nuit 100ml', 7000, 10000, 8500, NULL, '2023-04-20 07:31:27', 11, 0, 'Boss Nuit Pour Femme de Hugo Boss est un parfum Floral pour femme. Boss Nuit Pour Femme a été lancé en 2012. Les notes de tête sont Pêche et Aldéhydes; les notes de coeur sont Fleurs blanches, Jasmin et Violette; les notes de fond sont Bois de santal et Mousse.', NULL, '2023-04-20 12:04:56', 0, 35, 20, NULL, NULL, NULL, 105, 22),
(503, 'Boss Boltted 100ml', 7000, 10000, 8500, NULL, '2023-04-20 07:32:30', 7, 0, 'Bon parfum, Boss Bottled reste un classique pour moi, dynamique, frais, chaleureux. Il s\'illustre sur toutes les batailles, que ce soit l\'automne ou le printemps, l\'hiver ou l\'été. J\'adore ! Souvent parmis les top 10 des ventes et pour cause : il est simple mais parfaitement composé.', NULL, '2023-04-20 12:05:18', 0, 35, 20, NULL, NULL, NULL, 105, 22),
